import chai from "chai";
import request from "supertest";

const mongoose = require("mongoose");
import User from "../../../../api/users/userModel";
import api from "../../../../index";

const expect = chai.expect;
let db;
let user1token;
let token;
let userId;
let validMovieId = 200;
let validActorId = 27017;

describe("Users endpoint", () => {
    before(() => {
        mongoose.connect(process.env.MONGO_DB, {
            useNewUrlParser: true,
            useUnifiedTopology: true,
        });
        db = mongoose.connection;
    });

    after(async () => {
        try {
            await db.dropDatabase();
        } catch (error) {
            console.log(error);
        }
    });
    beforeEach(async () => {
        try {
            await User.deleteMany();
            // Register two users
            await request(api).post("/api/users?action=register").send({
                username: "user1",
                email: '123@163.com',
                password: "test123@",
            });
            await request(api).post("/api/users?action=register").send({
                account: "user2",
                email: 'test@qq.com',
                password: "test456@",
            });
        } catch (err) {
            console.error(`failed to Load user test Data: ${err}`);
        }
    });
    afterEach(() => {
        api.close();
    });

    // get all user
    describe("GET /api/users/", () => {
        it("should return a list of users", (done) => {
            request(api)
                .get("/api/users/")
                .set("Accept", "application/json")
                .expect("Content-Type", /json/)
                .expect(200)
                .end((err, res) => {
                    expect(res.body).to.be.an("array");
                    done();
                });
        });
    });

    // user register function
    describe("User register endpoint", () => {
        describe("POST /api/users/ - Registration Success Tests", () => {
            it("should successfully register a user with valid credentials", (done) => {
                request(api)
                    .post("/api/users/")
                    .query({action: 'register'})
                    .send({
                        username: "user777",
                        email: "user777@189.com",
                        password: "Password@123"
                    }) // Replace with valid credentials
                    .set("Accept", "application/json")
                    .expect("Content-Type", /json/)
                    .expect(201)
                    .end((err, res) => {
                        expect(res.body).to.be.an("object");
                        expect(res.body.success).to.be.true;
                        expect(res.body).to.have.property("token");
                        done();
                    });
            });
        });

        describe("POST /api/users/ - Registration Boundary Tests", () => {
            it("should return error for missing required fields", (done) => {
                request(api)
                    .post("/api/users/")
                    .query({action: 'register'})
                    .send({username: "newUser", email: "newuser@fail.com"}) // Missing password
                    .set("Accept", "application/json")
                    .expect(400)
                    .end(done);
            });

            it("should return error for invalid email format", (done) => {
                request(api)
                    .post("/api/users/")
                    .query({action: 'register'})
                    .send({username: "newUser", email: "invalidEmail", password: "Password@123"})
                    .set("Accept", "application/json")
                    .expect(400)
                    .end(done);
            });
        });

        describe("POST /api/users/ - Registration Failure Tests", () => {
            it("should return error for already existing username or email", (done) => {
                request(api)
                    .post("/api/users/")
                    .query({action: 'register'})
                    .send({
                        username: "user1",
                        email: "123@163.com",
                        password: "Password@123"
                    }) // Use existing username and email
                    .set("Accept", "application/json")
                    .expect(400)
                    .end(done);
            });
        });

    })

    // user login function
    describe("User login endpoint", () => {
        describe("POST /api/users/ - Login Success Tests", () => {
            it("should login successfully with correct email", (done) => {
                request(api)
                    .post("/api/users/")
                    .send({account: "123@163.com", password: "test123@"}) // Replace with valid credentials
                    .set("Accept", "application/json")
                    // .expect("Content-Type", /json/)
                    .expect(200)
                    .end((err, res) => {
                        expect(res.body).to.be.an("object");
                        expect(res.body).to.have.property("token");
                        done();
                    });
            });
            it("should login successfully with correct user name", (done) => {
                request(api)
                    .post("/api/users/")
                    .send({account: "user1", password: "test123@"}) // Replace with valid credentials
                    .set("Accept", "application/json")
                    // .expect("Content-Type", /json/)
                    .expect(200)
                    .end((err, res) => {
                        expect(res.body).to.be.an("object");
                        expect(res.body.success).to.be.true;
                        expect(res.body).to.have.property("token");
                        done();
                    });
            });
        });

        describe("POST /api/users/ - Login Boundary Tests", () => {
            it("should return error for missing account or password", (done) => {
                request(api)
                    .post("/api/users/")
                    .send({account: "user2"}) // Missing password
                    .set("Accept", "application/json")
                    .expect(400)
                    .end(done);
            });
        });

        describe("POST /api/users/ - Login Failure Tests", () => {
            it("should return error for incorrect credentials", (done) => {
                request(api)
                    .post("/api/users/")
                    .send({account: "invalidUser", password: "invalidPassword"})
                    .set("Accept", "application/json")
                    .expect(401)
                    .end(done);
            });
        });

    });

    // user profiles
    describe("User profiles endpoint", () => {

        beforeEach(async () => {
            //  ID
            const res = await request(api)
                .post("/api/users/")
                .send({
                    account: "user1",
                    password: "test123@"
                });
            token = res.body.token;
            userId = res.body.user.id;
        });

        // favorite movie page
        describe("Favorite movies page", () => {
            // get user favorite movies
            describe("Get user favorite movies", () => {
                describe("GET /api/users/tmdb/:id/favorites - Success Tests", () => {

                    it("should return favorite movies for a valid user ID", (done) => {
                        request(api)
                            .get(`/api/users/tmdb/${userId}/favorites`)
                            .set("Authorization", `${token}`)
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.be.a("array");
                                done();
                            });
                    });
                });

                describe("GET /api/users/tmdb/:id/favorites - Boundary Tests", () => {
                    it("should return 403 Forbidden for accessing another user's favorites", (done) => {
                        const otherUserId = '65885601eb0d0be90b272026';
                        request(api)
                            .get(`/api/users/tmdb/${otherUserId}/favorites`)
                            .set("Authorization", `${token}`)
                            .expect(403)
                            .end(done);
                    });
                });

                describe("GET /api/users/tmdb/:id/favorites - Failure Tests", () => {
                    it("should return 401 Unauthorized for invalid token", (done) => {
                        request(api)
                            .get(`/api/users/tmdb/${userId}/favorites`)
                            .set("Authorization", "Bearer invalidToken")
                            .expect(401)
                            .end(done);
                    });

                    it("should return 404 Not Found for non-existent user ID", (done) => {
                        const nonExistentUserId = '11111111111111111';
                        request(api)
                            .get(`/api/users/tmdb/${nonExistentUserId}/favorites`)
                            .set("Authorization", `${token}`)
                            .expect(403)
                            .end(done);
                    });
                });
            });
            // add and delete favorite movie
            describe("Add and delete favorites endpoint", () => {
                describe("POST /api/users/tmdb/:id/favorites - Success Test", () => {
                    it("should add a movie to favorites", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/${userId}/favorites`)
                            .set("Authorization", `${token}`)
                            .send({movieId: validMovieId})
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.have.property("message", "Movie added to favorites");
                                done();
                            });
                    });
                });

                describe("DELETE /api/users/tmdb/:id/favorites/:movieId - Success Test", () => {
                    it("should remove a movie from favorites", (done) => {
                        request(api)
                            .delete(`/api/users/tmdb/${userId}/favorites/${validMovieId}`)
                            .set("Authorization", `${token}`)
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.have.property("message", "Movie removed from favorites");
                                done();
                            });
                    });
                });

                describe("POST /api/users/tmdb/:id/favorites - Failure Test", () => {
                    it("should not add a movie to favorites if user is unauthorized", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/${userId}/favorites`)
                            .send({movieId: validMovieId})
                            .expect(401)
                            .end(done);
                    });
                });

                describe("DELETE /api/users/tmdb/:id/favorites/:movieId - Failure Test", () => {
                    it("should not remove a movie from favorites if user is unauthorized", (done) => {
                        request(api)
                            .delete(`/api/users/tmdb/${userId}/favorites/${validMovieId}`)
                            .expect(401)
                            .end(done);
                    });
                });

            });
        });

        // marked movie page
        describe("Marked movies page", () => {
            // get user marked movies
            describe("Get user marked movies", () => {
                describe("GET /api/users/tmdb/:id/marked - Success Tests", () => {
                    it("should return marked movies for a valid user ID", (done) => {
                        request(api)
                            .get(`/api/users/tmdb/${userId}/marked`)
                            .set("Authorization", `${token}`)
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.be.an("array");
                                done();
                            });
                    });
                });

                describe("GET /api/users/tmdb/:id/marked - Failure Tests", () => {
                    it("should return 401 Unauthorized for invalid token", (done) => {
                        request(api)
                            .get(`/api/users/tmdb/${userId}/marked`)
                            .set("Authorization", "Bearer invalidToken")
                            .expect(401)
                            .end(done);
                    });

                    it("should return 404 Not Found for non-existent user ID", (done) => {
                        const nonExistentUserId = 'nonExistentUserId';
                        request(api)
                            .get(`/api/users/tmdb/${nonExistentUserId}/marked`)
                            .set("Authorization", `${token}`)
                            .expect(500)
                            .end(done);
                    });
                });

            });

            // add and delete marked movies
            describe("Add and Delete marked movies", () => {
                describe("POST /api/users/tmdb/:id/marked - Success Test", () => {

                    it("should mark a movie successfully", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/${userId}/marked`)
                            .set("Authorization", `${token}`)
                            .send({ movieId: validMovieId })
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.have.property("message", "Movie marked successfully");
                                done();
                            });
                    });

                    it("should unmark a movie successfully", (done) => {
                        request(api)
                            .delete(`/api/users/tmdb/${userId}/marked/${validMovieId}`)
                            .set("Authorization", `${token}`)
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.have.property("message", "Movie unmarked successfully");
                                done();
                            });
                    });
                });

                describe("POST /api/users/tmdb/:id/marked - Failure Tests", () => {
                    it("should return error for unauthorized access", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/${userId}/marked`)
                            .send({ movieId: validMovieId })
                            .expect(401)
                            .end(done);
                    });

                    it("should return error for invalid user ID", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/invalidUserId/marked`)
                            .set("Authorization", `${token}`)
                            .send({ movieId: validMovieId })
                            .expect(403)
                            .end(done);
                    });
                });

            })
        });

        // follow actor page
        describe("Followed actors page", () => {

            // get followed actors
            describe("Get user followed actors", () => {
                describe("GET /api/users/tmdb/:id/follow - Success Test", () => {

                    it("should retrieve followed actors for a valid user ID", (done) => {
                        request(api)
                            .get(`/api/users/tmdb/${userId}/follow`)
                            .set("Authorization", `${token}`)
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.be.an("array");
                                done();
                            });
                    });
                });

                describe("GET /api/users/tmdb/:id/follow - Failure Tests", () => {
                    it("should return 401 Unauthorized for invalid token", (done) => {
                        request(api)
                            .get(`/api/users/tmdb/${userId}/follow`)
                            .set("Authorization", "Bearer invalidToken")
                            .expect(401)
                            .end(done);
                    });

                    it("should return 404 Not Found for non-existent user ID", (done) => {
                        const nonExistentUserId = '765413245689';
                        request(api)
                            .get(`/api/users/tmdb/${nonExistentUserId}/follow`)
                            .set("Authorization", `${token}`)
                            .expect(403)
                            .end(done);
                    });
                });
            });

            // add and delete actors
            describe("Add and delete followed actors", () => {
                describe("POST /api/users/tmdb/:id/follow - Success Test", () => {

                    it("should follow an actor successfully", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/${userId}/follow`)
                            .set("Authorization", `${token}`)
                            .send({ actorId: validActorId })
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.have.property("message", "Actor followed successfully");
                                done();
                            });
                    });

                    it("should unfollow an actor successfully", (done) => {
                        request(api)
                            .delete(`/api/users/tmdb/${userId}/follow/${validActorId}`)
                            .set("Authorization", `${token}`)
                            .expect(200)
                            .end((err, res) => {
                                expect(res.body).to.have.property("message", "Actor unfollowed successfully");
                                done();
                            });
                    });
                });

                describe("POST /api/users/tmdb/:id/follow - Failure Tests", () => {
                    it("should return error for unauthorized access", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/${userId}/follow`)
                            .send({ actorId: validActorId })
                            .expect(401)
                            .end(done);
                    });

                    it("should return error for invalid user ID", (done) => {
                        request(api)
                            .post(`/api/users/tmdb/invalidUserId/follow`)
                            .set("Authorization", `${token}`)
                            .send({ actorId: validActorId })
                            .expect(403) // or 404 based on your implementation
                            .end(done);
                    });
                });
            })
        })
    });


});

import mongoose from 'mongoose';
import bcrypt from 'bcrypt';
import {MovieSchema} from "../movies/movieModel"

const Schema = mongoose.Schema;

const UserSchema = new Schema({
    username: {type: String, unique: true, required: true},
    email: {
        type: String,
        unique: true,
        required: 'Email address is required',
        validate: {
            validator: function (email) {
                const regex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
                return regex.test(email);
            },
            message: props => `${props.value} is not a valid email address!`
        },
    },
    password: {
        type: String,
        required: 'Password is required',
        validate: {
            validator: function (password) {
                // 8
                const regex = /^(?=.*[A-Za-z])(?=.*\d)(?=.*[@$!%*#?&])[A-Za-z\d@$!%*#?&]{8,}$/;
                return regex.test(password);
            },
            message: props => `${props.value} is not a valid password!`
        },
    },
    favorites: [Number],
    marked: [Number],
    follow: [Number]
});

UserSchema.methods.comparePassword = async function (passw) {
    return await bcrypt.compare(passw, this.password);
}

UserSchema.statics.findByUserName = function (username) {
    return this.findOne({username: username});
};

UserSchema.statics.findByEmail = function (email) {
    return this.findOne({email: email});
};

UserSchema.pre('save', async function (next) {
    const saltRounds = 10; // You can adjust the number of salt rounds
    //const user = this;
    if (this.isModified('password') || this.isNew) {
        try {
            const hash = await bcrypt.hash(this.password, saltRounds);
            this.password = hash;
            next();
        } catch (error) {
            next(error);
        }

    } else {
        next();
    }
});

export default mongoose.model('User', UserSchema);

import mongoose from 'mongoose';

const Schema = mongoose.Schema;


const MovieSchema = new Schema({
  adult: { type: Boolean },
  id: { type: Number, required: true, unique: true },
  poster_path: { type: String },
  overview: { type: String },
  release_date: { type: String },
  original_title: { type: String },
  genre_ids: [{ type: Number }],
  original_language: { type: String },
  title: { type: String },
  backdrop_path: { type: String },
  popularity: { type: Number },
  vote_count: { type: Number },
  video: { type: Boolean },
  vote_average: { type: Number },
  production_countries: [{
    iso_3166_1: { type: String },
    name: { type: String }
  }],
  runtime: { type: Number },
  spoken_languages: [{
    iso_639_1: { type: String },
    name: { type: String }
  }],
  status: { type: String },
  tagline: { type: String }
});

MovieSchema.statics.findByMovieDBId = function (id) {
  return this.findOne({ id: id });
};

export default mongoose.model('Movies', MovieSchema);

import dotenv from 'dotenv';
import express from 'express';
import moviesRouter from './api/movies';
import actorsRouter from './api/actors';
import './db';
import './seedData'
import reviewsRouter from './api/reviews';
import usersRouter from './api/users';
import {passport} from "./authenticate";
import cors from "cors";
import defaultErrHandler from "./errHandler";

dotenv.config();

const app = express();
const port = process.env.PORT;

app.use(passport.initialize());

app.use(cors());
app.use(express.json());
app.use('/api/users', usersRouter);
app.use('/api/actors',  actorsRouter);
app.use('/api/movies',  moviesRouter);
app.use('/api/reviews',  reviewsRouter);

app.use(defaultErrHandler);
let server = app.listen(port, () => {
    console.info(`Server running at ${port}`);
});
module.exports = server

import movieModel from './movieModel';
import {
    getUpcomingMovies,
    getMoviesGenres,
    getTrendingMovies,
    getMovies,
    getMovieCredits,
    getMovieImages,
    getMovie, getMovieReviews
} from '../tmdb-api';
import asyncHandler from 'express-async-handler';
import express from 'express';

const router = express.Router();

router.get('/', asyncHandler(async (req, res) => {
    let { page = 1, limit = 10 } = req.query; // destructure page and limit and set default values
    [page, limit] = [+page, +limit]; //trick to convert to numeric (req.query will contain string values)

    // Parallel execution of counting movies and getting movies using movieModel
    const [total_results, results] = await Promise.all([
        movieModel.estimatedDocumentCount(),
        movieModel.find().limit(limit).skip((page - 1) * limit)
    ]);
    const total_pages = Math.ceil(total_results / limit); //Calculate total number of pages (= total No Docs/Number of docs per page)

    //construct return Object and insert into response object
    const returnObject = {
        page,
        total_pages,
        total_results,
        results
    };
    res.status(200).json(returnObject);
}));

// Get movie details
router.get('/:id', asyncHandler(async (req, res) => {
    const id = parseInt(req.params.id);
    const movie = await movieModel.findByMovieDBId(id);
    if (movie) {
        res.status(200).json(movie);
    } else {
        res.status(404).json({message: 'The movie you requested could not be found.', status_code: 404});
    }
}));

// discover movies
router.get('/tmdb/home', asyncHandler(async (req, res) => {
    try {
        const page = parseInt(req.query.page);
        const language = req.query.language;

        if (isNaN(page) || page <= 0 || !language) {
            throw new Error('Invalid parameters');
        }

        const movies = await getMovies(page, language);
        res.status(200).json(movies);
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));

// single movie
router.get('/tmdb/movie/:id', asyncHandler(async (req, res) => {
    try {
        const id = parseInt(req.params.id);
        if (isNaN(id) || id <= 0) {
            throw new Error('Invalid ID');
        }

        const movie = await getMovie(id);
        if (!movie) {
            res.status(404).json({ message: "The resource you requested could not be found." });
        } else {
            res.status(200).json(movie);
        }
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));


// upcoming movies
router.get('/tmdb/upcoming', asyncHandler(async (req, res) => {
    try {
        const page = parseInt(req.query.page);
        const language = req.query.language;

        if (isNaN(page) || page <= 0 || !language) {
            throw new Error('Invalid parameters');
        }

        const upcomingMovies = await getUpcomingMovies(language, page);
        res.status(200).json(upcomingMovies);
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));


// trending movies
router.get('/tmdb/trending', asyncHandler(async (req, res) => {
    try {
        const page = parseInt(req.query.page);
        const language = req.query.language;

        if (isNaN(page) || page <= 0 || !language) {
            throw new Error('Invalid parameters');
        }

        const trendingMovies = await getTrendingMovies(language, page);
        res.status(200).json(trendingMovies);
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));

// movies genres
router.get('/tmdb/genres', asyncHandler(async (req, res) => {
    try {
        const language = req.query.language || 'en-US'; // Default to 'en-US' if language is not provided

        const moviesGenres = await getMoviesGenres(language);
        res.status(200).json(moviesGenres);
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));

// 
router.get('/tmdb/movie_credits/:id', asyncHandler(async (req, res) => {
    try {
        const id = parseInt(req.params.id);
        if (isNaN(id) || id <= 0) {
            throw new Error('Invalid ID');
        }

        const movieCredits = await getMovieCredits(id);
        if (!movieCredits) {
            res.status(404).json({ message: "No movie credits found for the provided ID." });
        } else {
            res.status(200).json(movieCredits);
        }
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));

// movie images
router.get('/tmdb/movie/:id/image', asyncHandler(async (req, res) => {
    try {
        const id = req.params.id;
        if (!id || isNaN(Number(id))) {
            throw new Error('Invalid ID');
        }

        const movieImgs = await getMovieImages(id);
        if (!movieImgs) {
            res.status(404).json({ message: "No images found for the provided movie ID." });
        } else {
            res.status(200).json(movieImgs);
        }
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));

//reviews
router.get('/tmdb/movie/:id/review', asyncHandler(async (req, res) => {
    try {
        const id = req.params.id;
        if (!id || isNaN(Number(id))) {
            throw new Error('Invalid ID');
        }

        const movieReviews = await getMovieReviews(id);
        if (!movieReviews) {
            res.status(404).json({ message: "No reviews found for the provided movie ID." });
        } else {
            res.status(200).json(movieReviews);
        }
    } catch (error) {
        res.status(400).json({ error: error.message });
    }
}));




export default router;

import fetch from 'node-fetch';

export const getMovies = (page, language) => {

